pragma solidity ^0.6.6;
pragma experimental ABIEncoderV2;

import './Transactions.sol';

contract RawMaterial {

    address Owner;

    enum packageStatus { atCreator, picked, delivered }

    event ShippmentUpdate(
        address indexed ProductID,
        address indexed Transporter,
        address indexed Manufacturer,
        uint TransporterType,
        uint Status
    );

    address productid;
    bytes32 description;
    uint quantity;
    address transporter;
    address manufacturer;
    address supplier;
    packageStatus status;
    bytes32 packageReceiverDescription;
    address txnContractAddress;

    constructor (
        address _creatorAddr,
        address _productid,
        bytes32 _description,
        uint _quantity,
        address _transporterAddr,
        address _manufacturerAddr
    ) public {
        Owner = _creatorAddr;
        productid = _productid;
        description = _description;
        quantity = _quantity;
        transporter = _transporterAddr;
        manufacturer = _manufacturerAddr;
        supplier = _creatorAddr;
        status = packageStatus(0);
        Transactions txnContract = new Transactions(_manufacturerAddr);
        txnContractAddress = address(txnContract);
    }


    function getSuppliedRawMaterials () public view returns(
        address,
        bytes32,
        uint,
        address,
        address,
        address,
        address
    ) {
        return (productid, description, quantity, supplier, transporter, manufacturer, txnContractAddress);
    }



    function getRawMaterialStatus() public view returns(
        uint
    ) {
        return uint(status);
    }



    function pickPackage(
        address _transporterAddr
    ) public {
        require(
            _transporterAddr == transporter,
            "Only transporter of the package can pick package"
        );
        require(
            status == packageStatus(0),
            "Package must be at Supplier."
        );
        status = packageStatus(1);
        emit ShippmentUpdate(productid, transporter, manufacturer, 1, 1);
    }


    function receivedPackage(
        address _manufacturerAddr
    ) public {

        require(
            _manufacturerAddr == manufacturer,
            "Only Manufacturer of the package can receieve the package"
        );

        require(
            status == packageStatus(1),
            "Product not picked up yet"
        );
        status = packageStatus(2);
        emit ShippmentUpdate(productid, transporter, manufacturer, 1, 2);
    }
}

contracts/Transactions.sol.content:
pragma solidity ^0.6.6;
pragma experimental ABIEncoderV2;

contract Transactions {

    address Creator;

    struct txns {
        bytes32 txnHash;
        address fromAddr;
        address toAddr;
        bytes32 prevTxn;
        string latitude;
        string longitude;
        uint timestamp;
    }

    mapping(uint => txns) public transactions;
    uint public txnCount = 0;

    constructor(address _creator) public {
        Creator = _creator;
    }

    event txnCreated(bytes32 _txnHash, address _from, address _to, bytes32 _prev, uint _timestamp, string _latitude, string _longitude);

    function createTxnEntry(bytes32 _txnHash, address _from, address _to, bytes32 _prev, string memory _latitude, string memory _longitude) public {
        uint _timestamp = now;
        if(txnCount == 0) {
            transactions[txnCount] = txns(_txnHash, _from, _to, _prev, _latitude, _longitude, _timestamp);
        } else {
            require(transactions[txnCount - 1].txnHash == _prev, "Transaction error occurred!");
            transactions[txnCount] = txns(_txnHash, _from, _to, _prev, _latitude, _longitude, _timestamp);
        }
        txnCount += 1;
        emit txnCreated(_txnHash, _from, _to, _prev, _timestamp, _latitude, _longitude);
    }

    function getAllTransactions() public view returns(txns[] memory) {
        uint len = txnCount;
        txns[] memory ret = new txns[](len);
        for (uint i = 0; i < len; i++) {
            ret[i] = transactions[i];
        }
        return ret;    
    }
}
